import { Link } from 'react-router-dom';
import './error.css';

function Error() {
    return (
        <div className='not-found'>
            <h1>404</h1>
            <h2>Page not found!</h2>
            <Link to="/">Go to home</Link>
        </div>
    )

}

export default Error;
